  <style>
    body {
      margin: 0;
      height: 100vh;
      overflow: hidden;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      font-family: system-ui, -apple-system, BlinkMacSystemFont;
      background: linear-gradient(135deg, #0f0c29, #302b63, #24243e);
      color: white;
      text-align: center;
    }

    h1 {
      font-size: 2rem;
      margin-bottom: 40px;
    }

    .yes-button, .no-button {
      font-size: 1.2rem;
      padding: 12px 28px;
      border: none;
      border-radius: 12px;
      cursor: pointer;
      position: absolute;
      transition: transform 0.2s ease;
    }

    .yes-button {
      background: #22c55e;
      color: black;
      bottom: 30%;
      left: 50%;
      transform: translateX(-120%);
    }

    .no-button {
      background: #ef4444;
      color: white;
      bottom: 30%;
      left: 50%;
      transform: translateX(20%);
    }

    img {
      max-width: 90%;
      max-height: 90%;
      border-radius: 16px;
      box-shadow: 0 0 30px rgba(0,0,0,0.6);
    }
  </style>
</head>
